import { useState } from 'react';
import './App.css';
import SubmitForm from './components/SubmitForm';

function App() {
  const [formData, setFormData] = useState([]);
  return (
    <div className="App">
      <SubmitForm formData={formData} setFormData={setFormData}/>

      <table>
        <tbody>
          <th>
            <td>이름</td>
            <td>가격</td>
            <td>유형</td>
            <td>구입 날짜</td>
            <td>메모</td>
            <td>재구매 의사</td>
          </th>
          {formData.map(item => (
            <tr key={item.id}>
              <td>{item.name}</td>
              <td>{item.price}</td>
              <td>{item.category}</td>
              <td>{item.date}</td>
              <td>{item.memoText}</td>
              <td>{item.repurchase}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
